VALUES ('3540860012920', 'Miel de fleurs', 'Notre miel cettifié « agriculture biologique » respecte un cahier des charges très strict, aussi bien sur la zone de butinage, que sur le travail de l\'apiculteur, du rucher à rextraction, Il possède tous les critères exigés parla réglementation en vigueur et a subi de multiples contrôles et analyses garantissant un miel Principalement composé de sucres simples (glucose et fructose), le miel est d\'une grande valeur énergétique. Sa cristallisation est naturelle comme sa couleur claire ou foncée ; ces caractéristiques dépendant uniquement de son origine florale. Les miels riches en glucose et en lévulose restent liquides très longtemps. A à une température ambiante, idéalement entre 15 et 2000 Couleur : Ambrée Odeur : Senteur Florale Saveur : Goût agréable Texture : Texture crémeuse, se tartine facilement', 'https://static.openfoodfacts.org/images/products/354/086/001/2920/front_fr.4.400.jpg', '0.5', '0.1', '83.3', '74.6', '', '0.5', '0', '0', '', '0');

